#  -----*-----*-----*-----*----- Function to Predict Resale Price of Singapore Flat -----*-----*-----*-----*----- #
def regressionprediction(input_data):
    with open(r"C:\My Folder\Tuts\Python\Project\Project 6 - Singapore Flat Resale Prices\Dataset\singapore_flat_reasle_model.pkl", "rb") as f:
        model = joblib.load(f)

        # model predict the selling price based on user input
        y_predict = model.predict(input_data)
        # inverse transformation for log transformation data
        predicted_resale_price = y_predict[0]**2
        
        predicted_resale_price = round(predicted_resale_price, 2)

    return predicted_resale_price


